import { Row, Col} from 'react-bootstrap';
import CodePic from '../assets/png/code.png';

function ProjectEntry() {
  return (
    <div>
      <Row style={{
        border: '1px', borderStyle: 'solid', borderRadius: '20px', marginRight: '5vw', marginLeft: '5vw',
      }}
      >
        <Col style={{ paddingLeft: '3vw', paddingTop: '10vh', paddingBottom: '10vh' }}>
          <Row xs={1} className="p-2 mb-2  ">
            <h1 className="display-6">
              Project Name
            </h1>
          </Row>
          <Row xs={1} className="p-2 mb-2">
            <p className="lead">Technologies used</p>
          </Row>
          <Row xs={1} className="p-2 mb-2">
            <p className="lead">Project Description</p>
          </Row>

        </Col>
        <img
          src={`${CodePic}`}
          alt=""
          style={{
            width: '50%', objectFit: 'cover', borderRadius: '18px', padding: '0px',
          }}
        />

      </Row>

    </div>

  );
}

export default ProjectEntry;
